import React from "react";
import { Page, Text, View, Document, StyleSheet } from "react-pdf";

const PrintBill = ({ printData }) => {
  return (
    <Document>
      <Page>
        <Text fixed>{printData}</Text>
      </Page>
    </Document>
  );
};

export default PrintBill;
